import requests


# grabs coin of choice
def coinRaw(coin):
    url = f"https://api.coingecko.com/api/v3/simple/price?ids={coin}&vs_currencies=usd&include_market_cap=true&include_24hr_vol=true&include_24hr_change=true&include_last_updated_at=false"

    headers = {
        "accept": "application/json",
        "x-cg-api-key": "CG-2hkesH46tFZUkFQQrnqXZyTU"
    }

    response = requests.get(url, headers=headers)

    return response.text


